import { Typography } from "@material-ui/core";
import React from "react";
import CountUp from 'react-countup';

const AllRoomsStatus = () => {
  return (
    <Typography variant="h6">
      <CountUp end={100} duration={2.75}/>
    </Typography>
  );
};

export default AllRoomsStatus;
